import React, { Component } from "react";
import {
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarNav,
  MDBNavItem,
  MDBNavLink,
  MDBNavbarToggler,
  MDBCollapse,
  MDBBtn,
  MDBIcon,
} from "mdbreact";
import { BrowserRouter as Router, Link } from "react-router-dom";
import { Fragment } from "react";

class NavbarPage extends Component {
  state = {
    isOpen: false,
  };

  toggleCollapse = () => {
    this.setState({ isOpen: !this.state.isOpen });
  };

  render() {
    return (
      <Router>
        <MDBNavbar
          color="light-blue darken-4"
          dark
          expand="md"
          className="fixed-topd "
        >
          <MDBNavbarBrand>
            <strong className="white-text">Moncoiffeur</strong>
          </MDBNavbarBrand>
          <MDBNavbarToggler onClick={this.toggleCollapse} />
          <MDBCollapse id="navbarCollapse3" isOpen={this.state.isOpen} navbar>
            <MDBNavbarNav left>
              <MDBNavItem>
                <h5>
                  <Link to="/aboutus"> Qui est nous ? </Link>
                </h5>
              </MDBNavItem>
            </MDBNavbarNav>
            <MDBNavbarNav right>
              {" "}
              <Fragment>
                <Link to="/loginpro">
                  <MDBBtn color="dark">Ajouter Mon salon</MDBBtn>
                </Link>
                <Link to="/loginclient">
                  <MDBBtn color="black">
                    <MDBIcon icon="user-circle" /> Mon compte
                  </MDBBtn>
                </Link>
              </Fragment>
            </MDBNavbarNav>
          </MDBCollapse>
        </MDBNavbar>
      </Router>
    );
  }
}

export default NavbarPage;
